  02> WILLIAMS, Michael George Mackie m on 04.09.1935 to JACKSON, Margaret Hughlings
  b 30.09.1902 d 07.01.1969
  b 06.03.1906 d 05.08.1994
  | Michael b. at Gisborne, m. at Auckland and d, at "Pakaraka", Wairoa. Margaret, d/o
  John Hughlings Jackson and Margaret Woodward, b. at Remuera, Auckland and d, and
  bd. at Wairoa..
  Michael was educated at Huntley School and Christ's College. He was a farmer on
  "Mangatawhiti" Station, Ohuka, Wairoa in partnership with his brother, Paul from
  1928 to 1969. He served on the Wairoa Harbour Board (1936-41) and the Wairoa
  Hospital Board (1936-62, chairman 1946-55). He was a member of the Henry and William Williams Commemoration
  Trust (1951-68) and served on the Waiapu Diocesan Standing Committee (1949-55); the Waiapu Synod
  representing St Paul's Church, Wairoa (1947-55); and the Pukeora Sanitorium Committee, Waipukurau
  (1946-55). He was awarded the Coronation Medal. Michael was the original compiler of the Williams Family
  Tree.
  Refer "A Huguenot Family. The Descendants of John and Mary Mandeno" published by Evagean Publishing in
  1997 for details of Margaret's family.
  01> WILLIAMS, Sara Margaret
  b 24.09.1936
  Sara b. at Grey Lynn, Auckland. Address: "Pakaraka", PO Box 16, Wairoa.
  Sara was educated by correspondence and at Ardkeen and Maungaruhe Primary Schools prior to boarding at
  Queenswood School, Hastings and Nga Tawa, Marton. She then graduated DipHort, MAC from Massey
  Agricultural College. She farms "Pakaraka" farm, Wairoa. She was a 'pilot' tutor for the New Zealand
  Pony Clubs Association Eqvalan Instructor's Training Programme until it was up and functioning.
